import './index.css';
import greenBook from '../assets/images/green_book.png';

function Welcome() {
  return (
    <div className="Welcome">
        <div class="center_book">
            <img id="greenBook" src={ greenBook }></img>
        </div>
    </div>
  );
}

export default Welcome;
